import Header from '../components/Header';
import Navbar from '../components/navbar/navbar';
import Tracks from '../components/tracks/tracks';
import '../components/style.css';

const Page = () => (
    <div>
        <Header />
        <Navbar />
        <Tracks />
    </div>
)

export default Page;
